"use client"

import { Check, Crown, Shield, Star, Zap } from "lucide-react"
import { useState } from "react"

import { Button } from "@/components/ui/button"
import { Card, CardContent, CardFooter, CardHeader } from "@/components/ui/card"
import { Switch } from "@/components/ui/switch"
import { Badge } from "@/components/ui/badge"

export default function SubscriptionPage() {
  const [isAnnual, setIsAnnual] = useState(false)

  const plans = [
    {
      name: "Basic Plan",
      subtitle: "Bronze",
      price: isAnnual ? 8 : 10,
      color: "bg-gradient-to-br from-teal-400 to-teal-500",
      icon: Shield,
      features: [
        "Up to 5 job applications per month",
        "Generic resume review to ensure basic compliance",
        "Limited to local job applications",
        "Email support for basic inquiries",
      ],
      idealFor: "Individuals starting their job search on a budget",
      popular: false,
    },
    {
      name: "Advanced Plan",
      subtitle: "Silver",
      price: isAnnual ? 16 : 20,
      color: "bg-gradient-to-br from-blue-500 to-blue-600",
      icon: Zap,
      features: [
        "Up to 15 job applications per month",
        "Personalized resume optimization tailored to job postings",
        "Cover letter writing for all applications",
        "Job market insights and recommendations",
        "Email and live chat support",
      ],
      idealFor: "Professionals looking for targeted job applications",
      popular: false,
    },
    {
      name: "Premium Plan",
      subtitle: "Gold",
      price: isAnnual ? 40 : 50,
      color: "bg-gradient-to-br from-amber-400 to-amber-500",
      icon: Star,
      features: [
        "Unlimited job applications per month",
        "Interview preparation coaching for shortlisted opportunities",
        "LinkedIn profile optimization to attract recruiters",
        "Priority access to high-demand job postings",
        "Dedicated job application expert assigned to the client",
      ],
      idealFor: "Mid-career professionals or individuals seeking a career change",
      popular: true,
    },
    {
      name: "Exclusive Plan",
      subtitle: "Platinum",
      price: isAnnual ? 80 : 100,
      color: "bg-gradient-to-br from-purple-500 to-purple-600",
      icon: Crown,
      features: [
        "Global job application coverage (local and international)",
        "Dedicated career strategy consultation",
        "Access to premium job boards and exclusive postings",
        "Mock interviews with industry experts",
        "Custom networking and recruiter outreach",
        "24/7 priority support (email, chat, and phone)",
      ],
      idealFor: "Senior professionals, executives, or clients seeking high-profile roles",
      popular: false,
    },
  ]

  return (
    <div className="min-h-screen p-6 md:p-8 lg:p-12">
      <div className="max-w-7xl mx-auto">
        <div className="text-center mb-12">
          <h1 className="text-3xl md:text-4xl font-bold mb-4">Select Plan</h1>
          <p className="text-gray-600 mb-8">Choose the perfect plan to accelerate your career journey</p>

          <div className="flex items-center justify-center gap-3 mb-8">
            <span className={`text-sm ${!isAnnual ? "text-gray-900 font-medium" : "text-gray-500"}`}>Monthly</span>
            <Switch checked={isAnnual} onCheckedChange={setIsAnnual} />
            <span className={`text-sm ${isAnnual ? "text-gray-900 font-medium" : "text-gray-500"}`}>
              Annual{" "}
              <Badge variant="outline" className="ml-1 bg-green-50 text-green-600 border-green-200">
                Save 20%
              </Badge>
            </span>
          </div>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
          {plans.map((plan, index) => {
            const Icon = plan.icon
            return (
              <Card
                key={plan.name}
                className={`relative overflow-hidden transition-all duration-300 hover:shadow-xl ${
                  plan.popular ? "ring-2 ring-amber-400 scale-105 shadow-lg" : ""
                }`}
              >
                {plan.popular && (
                  <div className="absolute top-0 right-0 bg-amber-400 text-amber-900 px-3 py-1 text-sm font-medium rounded-bl-lg z-10">
                    Most Popular
                  </div>
                )}

                <CardHeader className={`${plan.color} text-white p-6 relative overflow-hidden`}>
                  <div className="absolute top-0 right-0 opacity-10 transform translate-x-1/4 -translate-y-1/4">
                    <Icon size={120} />
                  </div>
                  <div className="flex items-center gap-2 mb-1">
                    <Icon className="h-5 w-5" />
                    <h3 className="text-lg font-semibold">{plan.name}</h3>
                  </div>
                  <p className="text-sm opacity-90">{plan.subtitle}</p>
                  <div className="mt-4 flex items-baseline">
                    <span className="text-3xl font-bold">Â£{plan.price}</span>
                    <span className="text-sm opacity-90 ml-1">/month</span>
                  </div>
                </CardHeader>

                <CardContent className="p-6">
                  <ul className="space-y-3">
                    {plan.features.map((feature) => (
                      <li key={feature} className="flex items-start gap-3 text-sm">
                        <Check className="h-4 w-4 text-green-500 mt-1 shrink-0" />
                        <span>{feature}</span>
                      </li>
                    ))}
                  </ul>

                  <div className="mt-6 pt-6 border-t">
                    <p className="text-sm text-gray-600 font-medium">Ideal For</p>
                    <p className="text-sm mt-1">{plan.idealFor}</p>
                  </div>
                </CardContent>

                <CardFooter className="p-6 pt-0">
                  <Button
                    className={`w-full ${
                      plan.popular
                        ? "bg-amber-400 hover:bg-amber-500 text-amber-900"
                        : index === 0
                          ? "bg-teal-500 hover:bg-teal-600 text-white"
                          : index === 1
                            ? "bg-blue-500 hover:bg-blue-600 text-white"
                            : "bg-purple-500 hover:bg-purple-600 text-white"
                    }`}
                    variant={plan.popular ? "default" : "default"}
                  >
                    Choose Plan
                  </Button>
                </CardFooter>
              </Card>
            )
          })}
        </div>

        <div className="mt-12 text-center">
          <div className="bg-white p-6 rounded-lg shadow-sm max-w-2xl mx-auto">
            <h3 className="text-lg font-medium mb-2">Not sure which plan is right for you?</h3>
            <p className="text-gray-600 mb-4">Our team can help you find the perfect fit for your career goals</p>
            <Button variant="outline">Schedule a consultation</Button>
          </div>

          <p className="text-sm text-gray-500 mt-8">
            All plans include access to our basic job search platform and mobile app.
            <br />
            Prices shown in Pounds. Taxes may apply based on your location.
          </p>
        </div>
      </div>
    </div>
  )
}



